svg.script:
var r_angle = 0;
var y_angle = 0;
var g_angle = 0;
var w_angle = 0;
var bubbles_shift = 1;

var setint;

function $(sel) {
  return document.querySelector(sel);
}

function gw_upd() {
  $("#alarm").setAttribute("class", "invis");
  g_angle = r_angle - y_angle;
  w_angle = Math.sqrt(g_angle);
  $("#gray_arrow").setAttribute("transform", "rotate(" + (g_angle - 150) + " 912.7 871.2)");
  $("#white_arrow").setAttribute("transform", "rotate(" + (w_angle * 5 - 150) + " 1456 674.2)");

  if (w_angle > 0) {
    $("#bubbles").setAttribute("class", "");
  } else {
    $("#bubbles").setAttribute("class", "invis");
  }

  $("#red_label").textContent = "- " + r_angle + " (BAR)";
  $("#yellow_label").textContent = "- " + y_angle + " (BAR)";
  $("#gray_label").textContent = "- " + g_angle + " (BAR)";
  $("#white_label").textContent = "- " + w_angle.toFixed(2) + " (LPD)";

  // console.log("r_angle = " + r_angle + "\r\ny_angle = " + y_angle + "\r\ng_angle = " + g_angle + "\r\nw_angle = " + w_angle);
}

function rarr_dwn() {
  if(r_angle > 0 && r_angle >= y_angle + 5) {
    r_angle -= 5;
    gw_upd();
    $("#red_arrow").setAttribute("transform", "rotate(" + (r_angle - 150) + " 641.3 424.7)");
  } else {
    $("#alarm").setAttribute("class", "");
  }
}

function rarr_up() {
  if(r_angle < 300) {
    r_angle += 5;
    gw_upd();
    $("#red_arrow").setAttribute("transform", "rotate(" + (r_angle - 150) + " 641.3 424.7)");
  }
}

function yarr_dwn() {
  if(y_angle > 0) {
    y_angle -= 5;
    gw_upd();
    $("#yellow_arrow").setAttribute("transform", "rotate(" + (y_angle - 150) + " 1223.1 424.7)");
  }
}

function yarr_up() {
  if(y_angle < 300 && r_angle >= y_angle + 5) {
    y_angle += 5;
    gw_upd();
    $("#yellow_arrow").setAttribute("transform", "rotate(" + (y_angle - 150) + " 1223.1 424.7)");
  } else {
    $("#alarm").setAttribute("class", "");
  }
}

function animate() {
  if(bubbles_shift < 1146) {
    bubbles_shift += w_angle / 2;
    $("#queue").setAttribute("transform", "translate(" + bubbles_shift + " 0)");
  } else {
    bubbles_shift = 1;
    $("#queue").setAttribute("transform", "translate(" + bubbles_shift + " 0)");
  }
  requestAnimationFrame(animate);
}

$("#rb_left").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){rarr_dwn()}, 100);
}
$("#rb_left").onclick = function() {rarr_dwn()};
$("#rb_left").onmouseup = function() {clearInterval(setint)};

$("#rb_right").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){rarr_up()}, 100);
}
$("#rb_right").onclick = function() {rarr_up()};
$("#rb_right").onmouseup = function() {clearInterval(setint)};

$("#yb_left").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){yarr_dwn()}, 100);
}
$("#yb_left").onclick = function() {yarr_dwn()};
$("#yb_left").onmouseup = function() {clearInterval(setint)};

$("#yb_right").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){yarr_up()}, 100);
}
$("#yb_right").onclick = function() {yarr_up()};
$("#yb_right").onmouseup = function() {clearInterval(setint)};

$("#alarm_close").onclick = function() {
  $("#alarm").setAttribute("class", "invis");
};
$("#demonstrate_close").onclick = function() {
  $("#popup_demonstrate").setAttribute("class", "invis");
  $("#info").setAttribute("class", "");
};
$("#restrictor_close").onclick = function() {
  $("#popup_restrictor").setAttribute("class", "invis");
  $("#info").setAttribute("class", "");
};
$("#info").onclick = function() {
  $("#popup_demonstrate").setAttribute("class", "");
  $("#popup_restrictor").setAttribute("class", "");
}

setTimeout(function(){
  $("#popup_demonstrate").setAttribute("class", "");
  $("#popup_restrictor").setAttribute("class", "");
}, 400);

requestAnimationFrame(animate);
